import asynciofrom bot_data import dp, bot, product_data, profile_photo_pathfrom handlers import client, all_usersimport osasync def on_startup(_):    # Регистрируем обработчики    all_users.register_handlers_verification(dp)    client.register_handlers_client(dp)    # Запускаем бота    await dp.start_polling(bot)if __name__ == "__main__":    # Вызываем on_startup    asyncio.run(on_startup(None))    # Запускаем основную функцию    asyncio.run(main())